import {
  FormControl,
  FormGroup,
  InputLabel,
  Input,
  Typography,
} from "@mui/material";

const Container = styled(FormGroup)`
  width: 50%;
`;

const AddUser = () => {
  return (
    <Container>
      <Typography variant="h4">Add User</Typography>
      <FormControl>
        <InputLabel>Name</InputLabel>
        <Input />
      </FormControl>
      <FormControl>
        <InputLabel>Email</InputLabel>
        <Input />
      </FormControl>
      <FormControl>
        <InputLabel>Phone</InputLabel>
        <Input />
      </FormControl>
    </Container>
  );
};

export default AddUser;
